import { Box, Fab } from '@mui/material'
import React from 'react'

function EditProduct() {
  return (
    <div><Box sx={{ '& > :not(style)': { m: 1 } }}><Fab color="secondary" aria-label="edit">
    <EditIcon />
  </Fab></Box></div>
  )
}

export default EditProduct
